INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (35, '2024-05-27 21:11:30.179', '2024-05-27 21:11:30.179', null, 1, 0, 0, 102, 0, 'O\'Neill Men\'s Epic 4/3mm Back Zip Full Wetsuit              ', '["/crawling/product/31239Y5kt1L._AC_SR512_.jpg","/crawling/product/31SIdH933XL._AC_SR512_.jpg","/crawling/product/31420UjAwuL._AC_SR512_.jpg","/crawling/product/51JqE-6jr+L._AC_SR512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' The Epic has many of the same great features as our high-end wetsuits, including 100% UltraFlex DS neoprene, double seal neck closure, Lumbar Seamless Design (LSD) and re-engineered covert Blackout zipper. Clean graphics and sharp style line make the Epic the best value in the industry.  O’Neill, the original California surf, snow and lifestyle brand was founded in 1952 when a young man named Jack O’Neill took his unstoppable passion for surfing and used it to beat Mother Nature at her own game.  Pioneering the world’s first neoprene surf wetsuit, Jack had successfully found a way to extend his surf sessions in the bone-chilling breaks of Northern California. He opened up the garage doors to his first surf shop soon after. While many things have changed since those humble beginnings, Jack initial vision of producing functional and innovative riding products continues to inspire people and empower them to do what they love doing most.  Back Zip entry system with Blackout zipper provides easy entry and exit with a watertight seal.  Ultra Stretch, Super soft premium neoprene for superior feel, flexibility and high performance.  Measurably warmer, lighter and windproof exterior with water wicking interior thermal jersey layer.  Blind stitched and triple glued to create a watertight seam for increased durability. ');
