INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (46, '2024-05-27 21:38:40.163', '2024-05-27 21:38:40.163', null, 1, 0, 0, 102, 0, 'XUKER Women Men Wetsuit 2mm 3mm, Neoprene Wet Suits Front/Back Zip in Cold Water Full Body Dive Suit for Water Sports              ', '["/crawling/product/31tJeFDgjxL._AC_US512_.jpg","/crawling/product/41FMZMwwp+L._AC_US512_.jpg","/crawling/product/41xPZHB8Z0L._AC_US512_.jpg","/crawling/product/41jKsRbC31L._AC_US512_.jpg","/crawling/product/41L2Gl2TwWL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' XUKER believes that every journey, every adventure, and every moment spent in the water should be filled with excitement and comfort.  Let\'s redefine the way to experience water sports~  A wetsuit is more than equipment, it\'s an extension of your body. The wetsuit fits like a second skin, allowing you freedom of movement and comfort to immerse yourself in the aquatic world.  XUKER aims to interweave the concepts of exploration and comfort, offering a wetsuit brand for adventurers and comfort seekers alike.   Visit the Store    Visit the Store    Visit the Store   Women Men Wetsuit 2mm  Wetsuit for Women Men 3mm  Neoprene Gloves  Neoprene Camo Gloves  Wetsuit Gloves  Neoprene Diving Boots   Wetsuit for Kids ');
