INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (48, '2024-05-27 21:39:55.894', '2024-05-27 21:39:55.894', null, 1, 0, 0, 102, 0, 'OMGear Wetsuit Women Men 2mm 3mm Neoprene Dive Wet Suit for Cold Water Short/Full Body Thermal Swimsuit for Adults Snorkel Suit for Snorkeling Scuba Diving Swimming Surfing Spearfishing              ', '["/crawling/product/418Vlpba8TL._AC_US512_.jpg","/crawling/product/51bGNX9SkLL._AC_US512_.jpg","/crawling/product/51F1FVQRgWL._AC_US512_.jpg","/crawling/product/51Fd-SlxanL._AC_US512_.jpg","/crawling/product/51diVI4I+fL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' We are a manufacturer specializing in diving,surfing and swimming gears. In past 13 years,we have been making watersports gears for many well-known brands all over the world.   Visit the Store    Visit the Store    Visit the Store   1. You may smell  an odor when you received the wetsuit. Please don\'t worry, this smell  won\'t harm your body, it\'s environmentally and harmless glue smell. All  wetsuits have the smell.  2.  We use high quality PVC sealed bags to pack our kids wetsuits to reduce  damage to it during transportation. According to our quality policy,  when you open the package and find that the wetsuit has a slight fold  line, it is acceptable.  3. We kindly beg your understanding, because the fold lines cannot be completely avoided.  4,OMGear wetsuits are designed to fit a little  tight to provide maximum buoyancy and warmth for you. A well-fitted  wetsuit should allow you to breathe normally and move with some strength  but may feel slightly tightly. Just get used to it slowly.  5,Methods to clean and maintain：Rinse  the wetsuit inside and out with fresh water. Air dry it and avoid  hanging in sun light directly, as UV rays can cause your wetsuit to  break down faster.  When  storing this diving suit, hang it up as much as possible, otherwise it  is easy to leave crease and then the surface will not be smooth at the  next time you wear it. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (49, '2024-05-27 21:40:17.692', '2024-05-27 21:40:17.692', null, 1, 0, 0, 102, 0, 'LayaTone Wetsuits for Men Wetsuit Women, 3mm Neoprene Wetsuit Full Body Front Zipper Wet Suits for Diving Snorkeling Surfing Swimming in Cold Water              ', '["/crawling/product/31TEksDP0sL._AC_US512_.jpg","/crawling/product/41rTXwBAfzL._AC_US512_.jpg","/crawling/product/41rj4ygCpxL._AC_US512_.jpg","/crawling/product/41ZG4gUi0rL._AC_US512_.jpg","/crawling/product/41+potRPrUL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' DECORATE THE OCEAN  "LayaTone" global water sports brand, founded in 2004. We have 20 years of experience in the production and design of diving, scuba, surfing, snorkeling and other related products.  "Bold Innovation, Insist on Originality and Excellence" is our relentless pursuit of the goal!  YKK front zipper designed. The collar, cuffs and ankles are made of special super elastic material, which is 3 times more elastic than ordinary materials, keeps you warm and comfortable. The knees are made of super abrasion-resistant fabric to minimize the wear and tear of the wetsuit.  Its 3mm thickness is best used in water of 60-80℉, suitable for most waters seen daily, and also provides certain sun protection and UV protection functions. Provides you with powerful warmth and protection while you enjoy underwater sports.  LayaTone new 3mm full body wetsuit is made from high quality neoprene. The design of the new style is more ergonomic, snug and comfortable without feeling heavy or restricting body movement, and can effectively block the entry of water, making you feel warm even in cold water.  Wetsuits for Men Women  Womens Wetsuit  Mens Shorty Wetsuit  Kids Wetsuit  Wetsuit Tops ');
