INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (69, '2024-05-27 21:46:16.638', '2024-05-27 21:46:16.638', null, 1, 0, 0, 102, 0, 'Kids Wetsuit for Boys Girls 3mm Neoprene Back Zip Wet Suits Toddler Youth Keep Warm for Cold Water Paddleboarding Snorkeling Surfing Swimming              ', '["/crawling/product/310SszMT5vL._AC_US512_.jpg","/crawling/product/31VGafUUAsL._AC_US512_.jpg","/crawling/product/51EsLq+wk0L._AC_US512_.jpg","/crawling/product/514Phdhg0+L._AC_US512_.jpg","/crawling/product/51nSV-d6dBL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' Let your kids fully enjoy water fun  Our wetsuit brand GoldFin was born from a love of the ocean and a passion for adventure.  GoldFin has innovate and improve its products, incorporating feedback from customers and athletes to create wetsuits that meet the evolving needs of adventurers. Today, the brand is known for its commitment to quality, sustainability, and inclusivity, and inspire Water sports enthusiasts to pursue their happy and enjoy the fun brought by the ocean.  The underwater temperature will be lower than the land temperature, and wearing wetsuit can keep the body at a suitable temperature in the cold water.  Neoprene buoyancy material, The wetsuit is made of neoprene. Wetsuits can keep the body balance, help you float more easy in the water, and master swimming and diving skills faster.  In open water areas, wetsuit can prevent us from being harmed by sharp objects and prevent water pollution from causing allergic reactions to sensitive skin in our, Protect skin from UV damage.  Toddler wetsuit  Kids Wetsuit  Girls wetsuit  Girls wetsuit  Sleeveless Wetsuit kids  wetsuit tops kids  boys wetsuit  Boys wetsuit  Women Wetsuit  Wetuit for men  Wetsuit for women  women wetsuit tops  Women wetsuit pants  shorty wetsuit for women ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (70, '2024-05-27 21:46:52.041', '2024-05-27 21:46:52.041', null, 1, 0, 0, 102, 0, 'Mens Wetsuit Top Jacket - Neoprene Long Sleeve for Warmth & Comfort- Surfing, Snorkeling, All Watersports - w/Extended Back Flap and Durable YKK Locking Front Zipper              ', '["/crawling/product/312Sb4i743L._AC_US512_.jpg","/crawling/product/418TvOsDTOL._AC_US512_.jpg","/crawling/product/41n4oKuRu0L._AC_US512_.jpg","/crawling/product/51IhMXI8OyL._AC_US512_.jpg","/crawling/product/51wlJahwcxL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' I\'m Alec and grew up surfing in Dana Point, CA together with my co-founder Brian. We design all our surf gear and surf It ourselves!   Visit the Store    Visit the Store   We started Surf Squared because we couldn’t find surf gear we liked or didn\'t like repping large logos. The gear we did like, we couldn’t afford or didn\'t like spending our last shirt on.   We believe in creating top-quality and great looking surf gear, with the best value and best service.   Having grown up surfing from young age, we look to make high-performance surf gear that is durable, well designed without wild colors. We surf and test all our products every day.  We want our customers to have fun surfing and to surf better!   LET\'S GO SURFING!  Sasha with our ripper fiberglass thrusters.  Our Wetsuits keep you warm and comfy.  Seaside Quads for epic small wave performance. 
