INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (89, '2024-05-27 22:01:11.526', '2024-05-27 22:01:11.526', null, 1, 0, 0, 102, 0, 'Cressi Men\'s Ultraspan Scuba Diving Wetsuit made in Premium Material - Morea designed in Italy: quality since 1946              ', '["/crawling/product/31oCO8dbuVL._AC_US512_.jpg","/crawling/product/31XV-ihLHYL._AC_US512_.jpg","/crawling/product/317wIBIj6BL._AC_US512_.jpg","/crawling/product/31WyEvVbY1L._AC_US512_.jpg","/crawling/product/5154hyN11PL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '                          Cressi’s legacy of innovation began in 1939 with two brothers who shared a passion for the sea and begin by crafting masks and fins for free-divers and scuba divers.  Today, Cressi is one of the world\'s leaders in Water Sports equipment and the commitment to innovation is still in the company’s DNA. With specific divisions for different water enthusiasts, it delivers products worldwide, maintaining its commitment to develop and manufacture products with the highest level of quality and passion.  The Morea is a one-piece full wetsuit ideal for diving in warm waters. It is made in Ultraspan Neoprene that is limber and allows the user to have complete free movements without feeling tight. That makes the Morea an ideal equipment for many different water sports, such as surfing, paddle boarding, snorkeling, and scuba diving. It offers excellent protection against abrasion, while at the same time, providing the thermal protection needed while diving.  Cressi wetsuits are perfect for use in all watersport activities. They provide excellent thermal protection while in the water and are made with neoprene for ultimate comfort. High stretch neoprene offers the perfect balance between warmth and flexibility. Some wetsuits also have added protection on the chest, knees, and shins to prevent abrasions while in use. The neck seal on all our wetsuits are adaptable to molding to your neck and prevents irritation, making it easy and effortless to breathe. All of these factors also help to prolong the life of your wetsuit.  With the goal of reducing water leaks, the dorsal YKK zipper is equipped with an Aquastop flap. The flap also protects skin from being pinched by the zipper. The zipper can be fastened with a neck tab closure with velcro fasteners to ensure the zipper stays secure during your dive.  A shorty wetsuit covers the torso and part of the arms and legs, making it ideal for warmer temperature environments. They prevent overheating while out of the water, while also providing thermal protection to the core while in the water. A Shorty is also a great tool to protect yourself from sun‘s harmful rays.Full wetsuits cover the majority of the body from the neck to the ankles. They are ideal for cooler environments, as well as for those who will be in the water for longer periods of time. Full wetsuits also protect more skin surface from the underwater environment such as stings and abrasions.Personal choice is also a factor on decision making. A full wetsuit can be used on a hot day if the user wants added protection to the arms and legs. It´s all about safety and comfort. 
