INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (97, '2024-05-27 22:01:49.704', '2024-05-27 22:01:49.704', null, 1, 0, 0, 102, 0, 'Men Wetsuits with Waterproof Changing Mat Bag, Upgrade CR Neoprene 3/2mm Full Suits, Ideal Thermal Diving Suit in Cold Water, Back Zip for Surfing Snorkeling Diving Swimming              ', '["/crawling/product/41DRfbwdW0L._AC_US512_.jpg","/crawling/product/519XLY-qG3L._AC_US512_.jpg","/crawling/product/512So6339XL._AC_US512_.jpg","/crawling/product/518vrH9RcnL._AC_US512_.jpg","/crawling/product/51n4fwijJEL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' Lansru will accompany you on your journey of self-discovery, bringing endless surprises and achievements.  Explore Your Limits  At Lansru, we firmly believe that every individual has unlimited potential. We focus on manufacturing state-of-the-art, comfortable, and flexible water sports products, constantly innovating and striving for progress, committed to providing users with safe and comfortable water sports solutions.  Our goal is to Inspire individuals to surpass their self-limitations and unleash their true abilities.  The founder of the Lansru brand is an adventurous individual with a deep passion for diving, who has been fascinated by the blue ocean since childhood. He firmly believes that true potential can only be realized when our body and mind are at ease.  As a result, he has dedicated significant time and effort to researching fabric technology, ensuring that their diving suits offer exceptional comfort and flexibility.  Through Lansru\'s products, he aims to to Inspire individuals to surpass their self-limitations and unleash their true abilities.  1. Fabric Upgrade: SCR and CR materials, lower odor emissions.  2. AMZ CPF Recognization: By utilizing Environmentally materials and technologies. Avoid chemicals that ma