INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (116, '2024-05-27 22:03:10.964', '2024-05-27 22:03:10.964', null, 1, 0, 0, 102, 0, 'Lemorecn Wetsuits Adult\'s Premium Neoprene Diving Suit 3mm Shorty Wetsuits              ', '["/crawling/product/31ksiRyMsLL._AC_US512_.jpg","/crawling/product/31jimOlbgZL._AC_US512_.jpg","/crawling/product/31VnPQonf+L._AC_US512_.jpg","/crawling/product/4158pJAG9rL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' KEEP WARM, BRING COMFY, PROVIDE PROTECTION FOR YOUR AQUATIC SPORTS.  EXPLORE THE UNKNOW  CHALLENGE YOURSELF  ENJOY THE FREEDOM  Lemorecn Wetsuits  Men\'s 3mm Shorty  Designed for comfort and warmth , while also featuring high quality premium neoprene material and flatlock seams.  Anatomically cut pattern provides a glove-like fit and patterned to fit the widest variation of sizes and shapes.  Packed with all of the necessary features like extra-long leash,heavy-duty #10 YKK zipper; the wetsuit is an outstanding value.  Ideal for long-lasting mobility of diving, surfing, snorkeling and virtually all underwater and topside watersports; perfect in all conditions from warm to temperate, and even cold water.  Multi-Sport  Designed to increase warmth without increasing thickness allowing you to surf, paddleboard, windsurf, water ski, wakeboard lighter, longer, and warmer.  Durability  The wetsuit is designed with flatlock seams for improved durability.The extra durability and reliability makes this wetsuit ideal for those that spend hours in the water.  Warmth  Designed to increase warmth allowing you to dive, snorkel, and scuba, longer, and warmer.  Flat Lock Stitching Flat lock stitching throughout to reduce seam irritation Extra Large Zip #10 YKK Zip Water Activities Multi-Sport   Perfect for for diving, paddleboarding, kiteboarding, wakeboarding, kayaking, canoeing and other water sports. Keep you warm in the coldest conditions . ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (117, '2024-05-27 22:03:19.049', '2024-05-27 22:03:19.049', null, 1, 0, 0, 102, 0, 'Seaskin Surfing Wetsuit for Mens Womens 3/2mm Chest Zip GBS Full Wetsuit              ', '["/crawling/product/31DXiJrcNjL._AC_US512_.jpg","/crawling/product/51DYdOnN79L._AC_US512_.jpg","/crawling/product/51L9XiMHLwL._AC_US512_.jpg","/crawling/product/513wkvgfyuL._AC_US512_.jpg","/crawling/product/51qqG-8zCyL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  Visit the Store    Visit the Store    Visit the Store    Visit the Store    Visit the Store   Featuring highest quality, rapid-dry thermal  lined limestone  neoprene, combined with the best level of seam  construction, this is the  warmest 3mm/2mm wetsuit.  3mm/2mm Liquid Taped Thermal Chest Zip wetsuit has been developed for water temperatures ranging from 20°C to 28°C.  Full black color, 3mm for body and neck,  2mm for arm and calf.  Super stretch jersey on double side.  Super stretch jersey outside and smooth skin inside of  Our continuous product development is based on review received from   customers like YOU. So make the perfect choice-trust Seaskin and enjoy   your favorite water sports. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (118, '2024-05-27 22:03:22.850', '2024-05-27 22:03:22.850', null, 1, 0, 0, 102, 0, 'Wetsuit Women 3mm Neoprene Wet Suit for Women Cold Water Swimming with Back Zipper, Suitable for Diving, Swimming, Surfing, Snorkelingand Other Water Sports              ', '["/crawling/product/41sDyqGsQAL._AC_US512_.jpg","/crawling/product/51nEEvXxvML._AC_US512_.jpg","/crawling/product/41XVgoZ+mOL._AC_US512_.jpg","/crawling/product/510ez7hjZfL._AC_US512_.jpg","/crawling/product/51hVUD4wo2L._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  What Water Activities Can I Wear My Wetsuit for?  The Wetsuit a visrsatile and suitable for a variety of water activities, such as kayaking, paddleboarding, surfing, snorkeling, swimming. keep you warm in cold weather.And it\'s water repellent as well.  How to clean & store my wet suits?  Rinse the wetsuit inside and outside with fresh water after each use. Hang to dry out of direct sunlight. Store with hanger in a cool & dry place.  Is there an odour smelling when I first receive my neoprene wetsuit?  The new wetsuit may have odour smell, however, when you took out the package and leave it for few hours in the air, smelling will be gone. And it caused during wetsuit trimming & package stage, and it\'s harmless. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (119, '2024-05-27 22:03:27.616', '2024-05-27 22:03:27.616', null, 1, 0, 0, 102, 0, 'Kids Wetsuit - 3/2 mm Premium CR Neoprene Full Suit | UV Protection | Back Zip for Surfing, Swimming, Snorkeling, Diving, Kayaking | Ideal Thermal Swimsuits in Cold Water | Boys & Girls              ', '["/crawling/product/41cb4qnZ4zL._AC_US512_.jpg","/crawling/product/51cIi+nv+9L._AC_US512_.jpg","/crawling/product/51HSq6Ec9RL._AC_US512_.jpg","/crawling/product/51hR9MnHZtL._AC_US512_.jpg","/crawling/product/51YLFlRleqL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' Lansru will accompany you on your journey of self-discovery, bringing endless surprises and achievements.  Explore Your Limits  At Lansru, we believe that every child has unlimited potential. We are a brand specializing in children\'s diving suits, dedicated to inspiring individuals to surpass their self-imposed limitations and unleash their true abilities. We understand the mystery and beauty of the underwater world, and through our products and mission, we aim to help children explore this captivating realm and become their own heroes.   Visit the Store    Visit the Store   The founder of the Lansru brand is an adventurous individual with a deep passion for diving, who has been fascinated by the blue ocean since childhood. He firmly believes that true potential can only be realized when our body and mind are at ease.  As a result, he has dedicated significant time and effort to researching fabric technology, ensuring that their diving suits offer exceptional comfort and flexibility.  Through Lansru\'s products, he aims to encourage children to overcome fear and bravely plunge into the ocean, exploring the unknown world.  Build a world that protects children\'s potential and allows them to naturally showcase more possibilities. No one will define who they are or what achievements they can achieve. When it comes to their passion for the ocean and nature, give them the freedom to explore, discover, and decide for themselves.  Ultra Elastic is a diving suit series that uses upgraded SCR and CR fabrics, showcasing unparalleled flexibility and extraordinary range of motion. It allows them to delve deeper, reach higher levels, and unleash their true potential.  1. Fabric Upgrade: SCR and CR materials, lower odor emissions.  2. AMZ CPF Recognization: By utilizing Environmentally materials and technologies. Avoid chemicals that maybe harmful to human health.  We aim to minimize odor issues and provide our customers with comfortable and fresh-smelling diving suits.  As a brand, we understand the crucial role that comfort and flexibility play in fostering confidence and enabling young divers to explore the underwater world with ease.  We are passionate about what we do because we believe in the transformative power of diving.  We have witnessed firsthand how this activity inspires children to surpass their limits, overcome fears, and unleash their potential.  Wetsuit for Kids & Youth  Wetsuit for Girls  Wetsuit for Boys  Shorty Wetsuit for Girls  ');
