t size from Skyone size chart.  •Hands wash with cool water, Do not machine wash  •Due to everyone’s stature is difference and measuring   tolerance ±1cm allowed, if you feel not fit for your size, please simply   contact with us freely  •PACKAGE INCLUDE:One Piece Full Body Diving Skin  There\'s no better way to enter the water than with Skyone diving skin, wrap yourself in pure Comfort and Performance  Soft comfortable and close skin  Fit wrist and leg perfectly  Back zip with draw cord-Easy entry and off  Avoid the friction to skin  Does this full body Dive Skins smell?   A little, but don\'t worry, the Dive Skins uses glue from material, which is harmless and the smell will dissipate after a few days.  What is the best way to clean the Dive Skins ?   I suggest handwashing in cold to lukewarm water; hang to dry.  Is the full body Dive Skins zipper heavy duty?  YES,Easy on and off with strong front zipper design, fit tight and snug,excellent stretch provides your a free movement without restriction.  How loose do they get in the water?  Not loose at all! Beautifully designed, warm, snug. The women wetsuit is to keep you warm in the cold water.  3MM Full Body Wetsuit  3MM Shorty Wetsuit  2MM Shorty Wetsuit  3MM Wetsuit top  3MM Wetsuit pants  1.5MM Wetsuit top  2.5MM Full body wetsuit ');
