INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (175, '2024-05-27 22:11:03.168', '2024-05-27 22:11:03.168', null, 1, 0, 0, 102, 0, 'PROTAURI Wetsuit Women 3MM，Thicker Neoprene Diving Suit Front Zip Keep Warm in Cold Water, One Piece Full Body Wetsuits Long Sleeves Swimsuit UV Protection for Surfing/Scuba/Snorkeling/Swimming              ', '["/crawling/product/318SkfKkejL._AC_US512_.jpg","/crawling/product/41Ku7EoW1+L._AC_US512_.jpg","/crawling/product/51u1DURzpxL._AC_US512_.jpg","/crawling/product/41U1FYgzruL._AC_US512_.jpg","/crawling/product/41JcAV7pDLL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' To provide you with more professional and fashionable diving suits  PROTAURI is committed to providing high-quality and reliable products to customers around the world.  In the diving field, we listen to the opinions of experts and customers, constantly update and iterate, just in order to bring customers better and more professional diving products.  We always adhere to the "CUSTOMER FRIST" principle. PROTAURI sincerely invites you to use our products with us and embark on an ocean adventure.   Visit the Store   First of all you should measure  WAIST, BUST and HIPS  Wetsuits are elastic and can be extended by 1-3 cm.  Front zipper is better for wearing; back zipper is easier to reduce resistance  Nature OCEAN theme, highlighting the theme of environmenta, nature, fashion and saving.The blue floral design is transformed by waves, sea flowers and coral.The purple floral design is mainly mermaid fish scales with a gradient effect that makes you shine in the sun.  More elastic fabric, insulation at the same time to ensure the softness, a perfect fit for the body.  The multiple stitching ensures that the firmness will not crack and the underwater movement is more flexible.  Longer back opening zipper for easier on/off.  Effectively reduces water flow and provides insulation ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (176, '2024-05-27 22:11:08.613', '2024-05-27 22:11:08.613', null, 1, 0, 0, 102, 0, 'Ho Stevie! Men’s Surfing Wetsuit - Chest Zip Fullsuit - Warm Superstretch 3/2mm or 4/3mm Neoprene w/GBS Seams              ', '["/crawling/product/41S7+656RKL._AC_US512_.jpg","/crawling/product/51YeiOM3a4L._AC_US512_.jpg","/crawling/product/51xp2v8MUvL._AC_US512_.jpg","/crawling/product/51fZljxs5uL._AC_US512_.jpg","/crawling/product/51nDmodjZuL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' I\'m Stevie, and this is my wife B. We are at our San Diego surf shop, ready to answer any of your questions.  It\'s kind of a Hawaiian slang to say "ho" instead of "hey".  So my buddy would always come over to my house and say "Ho Stevie let\'s go surf!"  Our first product was a mouth mount for GoPro cameras, so surfers could capture their POV while keeping their hands free for surfing. From there, we added more surf gear, one thing at a time... fins, leashes, traction pads, board socks, etc.   I surf with these products every day.  I want to bring you the best quality gear, with the best value, and best service.   Visit the Store    Visit the Store    Visit the Store    Visit the Store    Visit the Store    Visit the Store   The Ultimate Surfing Wetsuit  If you don’t live in a tropical area, you’re going to need a wetsuit to keep you warm while surfing or doing other water sports.  And if you’re surfing for 1-2 hours at a time, you’ll want a high quality wetsuit so you retain all of your body heat. We’ve got you covered.  Thick premium neoprene keeps you warm in cold water.  Our 4/3mm wetsuit  is rated for water as cold as 51°F, and 3/2mm wetsuit is rated for water temperatures 56°F and warmer.  We built our seams to keep you warm.   Soft inner lining feels buttery against your skin, and retains maximum body heat, so you can stay warmer and surf longer.  Dries fast when you hang your wetsuit inside out after surfing.  Our chest zipper is always "attached", so you can zip/unzip it with one hand.  Key loop keeps your key safely tucked away.  Liquid Tape inside the ankle and wrist cuffs stops the cold water from flushing through, and keeps the wetsuit in place around your arms/legs.  Durable knee pads protect your knees and your wetsuit from abrasion that may happen during pop ups.  Should I get the same size wetsuit as I wear in other brands, or does yours fit differently?  Every brand fits differently, so please check our size chart for the right fit! If you\'re in between sizes, choose the bigger size, or message us and we\'ll help you.  Does the wetsuit have a thermal lining?  Yes! Both thicknesses have thermal lining on the torso and upper leg areas to keep you extra warm.  What temperature is this wetsuit rated for?  Every person has a different cold tolerance, but the 4/3mm premium neoprene is rated for water temperatures as cold as 51°F, and the 3/2mm is rated for water temperatures 56°F and warmer.  Does this wetsuit have GBS seams?  Yes, this is the key for warmth. We use GBS and taped seams throughout the entire wetsuit, not just certain sections like other brands.  Men\'s Wetsuit  5/4 Hooded Men\'s Wetsuit  Short Sleeve Wetsuit  Long Sleeve Springsuit  Short Sleeve Springsuit  Changing Mat  Wetsuit Hanger ');
