pressure.The chest and back sharkskin panels provide good wind resistance to surfers.  More durable and comfortable:The CR material is stable in nature.The ultra soft and stretch material ensures excellent flexibility and durability.If you wash your hands after use,drip dry,you can extend the service life. 
