cs, exercises, and other water activities.makes you more comfortable in and out of the water and keep you warm in the cold water.  1. Improve body shape and defines the waistline,super-stretch nylon fabric and perfect shape recovery  2. Provides sun protection and avoid bites and bruises from sea creatures,Super comfortable in the water.  3. Waterproof and add buoyancy, gets muscles warmed quickl, expedite calorie burning while working out.  4. Stays dry on the outside while sweating the inside,keep warm in the coldest conditions.  The smell of Neoprene is normal and not dangerous, it would be easy gone after a few time washes.  For someone whose skin is sensitive with Neoprene, they may feel itching or tingling after wearing these surfing pants, please take it off immediately and stop using.  Slightly fade is normal for bright color, use neutral detergent with cold, freshwater to rinse your diving pant.  Handwash in cold water with mild detergent and hand try, no iron, no bleach. ');
