INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (197, '2024-05-27 22:15:56.653', '2024-05-27 22:15:56.653', null, 1, 0, 0, 102, 0, 'Ho Stevie! Men’s Surfing Wetsuit - Chest Zip Fullsuit - Warm Superstretch 3/2mm or 4/3mm Neoprene w/GBS Seams              ', '["/crawling/product/41S7+656RKL._AC_US512_.jpg","/crawling/product/51YeiOM3a4L._AC_US512_.jpg","/crawling/product/51xp2v8MUvL._AC_US512_.jpg","/crawling/product/51fZljxs5uL._AC_US512_.jpg","/crawling/product/51nDmodjZuL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' I\'m Stevie, and this is my wife B. We are at our San Diego surf shop, ready to answer any of your questions.  It\'s kind of a Hawaiian slang to say "ho" instead of "hey".  So my buddy would always come over to my house and say "Ho Stevie let\'s go surf!"  Our first product was a mouth mount for GoPro cameras, so surfers could capture their POV while keeping their hands free for surfing. From there, we added more surf gear, one thing at a time... fins, leashes, traction pads, board socks, etc.   I surf with these products every day.  I want to bring you the best quality gear, with the best value, and best service.   Visit the Store    Visit the Store    Visit the Store    Visit the Store    Visit the Store    Visit the Store   The Ultimate Surfing Wetsuit  If you don’t live in a tropical area, you’re going to need a wetsuit to keep you warm while surfing or doing other water sports.  And if you’re surfing for 1-2 hours at a time, you’ll want a high quality wetsuit so you retain all of your body heat. We’ve got you covered.  Thick premium neoprene keeps you warm in cold water.  Our 4/3mm wetsuit  is rated for water as cold as 51°F, and 3/2mm wetsuit is rated for water temperatures 56°F and warmer.  We built our seams to keep you warm.   Soft inner lining feels buttery against your skin, and retains maximum body heat, so you can stay warmer and surf longer.  Dries fast when you hang your wetsuit inside out after surfing.  Our chest zipper is always "attached", so you can zip/unzip it with one hand.  Key loop keeps your key safely tucked away.  Liquid Tape inside the ankle and wrist cuffs stops the cold water from flushing through, and keeps the wetsuit in place around your arms/legs.  Durable knee pads protect your knees and your wetsuit from abrasion that may happen during pop ups.  Should I get the same size wetsuit as I wear in other brands, or does yours fit differently?  Every brand fits differently, so please check our size chart for the right fit! If you\'re in between sizes, choose the bigger size, or message us and we\'ll help you.  Does the wetsuit have a thermal lining?  Yes! Both thicknesses have thermal lining on the torso and upper leg areas to keep you extra warm.  What temperature is this wetsuit rated for?  Every person has a different cold tolerance, but the 4/3mm premium neoprene is rated for water temperatures as cold as 51°F, and the 3/2mm is rated for water temperatures 56°F and warmer.  Does this wetsuit have GBS seams?  Yes, this is the key for warmth. We use GBS and taped seams throughout the entire wetsuit, not just certain sections like other brands.  Men\'s Wetsuit  5/4 Hooded Men\'s Wetsuit  Short Sleeve Wetsuit  Long Sleeve Springsuit  Short Sleeve Springsuit  Changing Mat  Wetsuit Hanger ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (198, '2024-05-27 22:16:01.266', '2024-05-27 22:16:01.266', null, 1, 0, 0, 102, 0, 'Men Wetsuit Neoprene Wet Suits Womens 3mm Full Body Long Sleeves Front Zipper Swimsuit for Scuba Diving Swimming Surfing Adult in Cold Water              ', '["/crawling/product/41YlXyi3EDL._AC_US512_.jpg","/crawling/product/51gTdECjnNL._AC_US512_.jpg","/crawling/product/41fIsJHrvwL._AC_US512_.jpg","/crawling/product/41K8dBF2q7L._AC_US512_.jpg","/crawling/product/416Q1jykbfL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' REALON Water Sports Goods.We designed a variety of wetsuits and rash guards for mens/womens and boys/girls of all ages.The wetsuits are made of premium neoprene,suitable for surfing, scuba diving, snorkeling, swimming, standup paddle boarding etc. Ultra soft and super stretch neoprene,flatlock stitch construction gives you a compression and comfortable fit.Athletic tight fitting leggings,provide firm control to your body,shape a sexy curve for you.  REALON Wetsuit made of premium CR neoprene with stretchy nylon fabric, wind and water proof. The CR wetsuit keep you warm and good body protection while you are snorkeling,swimming,scuba diving,surfing,sailing,kayaking,canoeing,paddling,rafting,beach activities.REALON Wetsuit is your ideal choice!  REALON Wetsuit Features:  Better warmth keeping: Suitable for both experienced divers and beginners, full surfing and diving suits for water temperatures between 45 and 55°F. 2mm, 3mm, 5mm different thickness for choice, provide all aspects of warmth to your body.  Super-elastic material:Provide you with more freedom and unlimited space for a variety of water and underwater activities.  Better wind resistance and water buoyancy: While you snorkel or dive,this wetsuit provides you extra buoyancy in water and release water pressure.The chest and back sharkskin panels provide good wind resistance to surfers.  More durable and comfortable:The CR material is stable in nature.The ultra soft and stretch material ensures excellent flexibility and durability.If you wash your hands after use,drip dry,you can extend the service life. 
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (199, '2024-05-27 22:16:08.188', '2024-05-27 22:16:08.188', null, 1, 0, 0, 102, 0, 'Wetsuit Pants 3mm/1.5mm Neoprene Pants Long Pants Men Women Surfing Pants Keep Warm Diving Pants for Diving Swimming Snorkeling Scuba Sailing Surfing              ', '["/crawling/product/31J+8BH9tWL._AC_US512_.jpg","/crawling/product/31z0huimSSL._AC_US512_.jpg","/crawling/product/513rqslQGSL._AC_US512_.jpg","/crawling/product/41IkqPrNYLL._AC_US512_.jpg","/crawling/product/41hp0U0eOdL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' Material: 90% neoprene and 10% nylon  Thickness: 1.5mm / 3mm  Feature: Dry quickly, Keep warm , Flexibility ,UV protection and comfortable.  Applications: The wetsuit pants are great for snorkeling, diving, kayaking, canoeing,swimming, surf,and other water sports.  HOW TO CHOOSE THE SIZE:  1.Please refer to our size chart befer you choose the right size."Height" and" weight "are important reference factors in size selection.  MAINTENANCE OF WETSUIT  * Wash by hand under 30 degrees Celsius water  * DON\'T twist, DON\'T washing machine  * Do not bleach or wash with washing powder  *Put it in a cool place to dry after washing to avoid sunlight ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (200, '2024-05-27 22:16:15.288', '2024-05-27 22:16:15.288', null, 1, 0, 0, 102, 0, 'AXESEA Women\'s Wetsuit One Piece Shorty Wetsuit Eco Friendly Thermal Long Sleeve Front Zipper Diving Suit              ', '["/crawling/product/31QtvvtEmPL._AC_US512_.jpg","/crawling/product/41XpXrIBWML._AC_US512_.jpg","/crawling/product/41EccvCEIqL._AC_US512_.jpg","/crawling/product/51MqKraObSL._AC_US512_.jpg","/crawling/product/51KIe5Y8+-L._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  Visit the Store    Visit the Store    Visit the Store    Visit the Store   As big as the earth is, we are one  AXESEA designs and produces quality swimwear, wetsuits, and water sports accessories.  AXESEA was born in 2010 when three surfers in Australia on a common search for high-quality, affordable swimwear that stands up to the harsh elements of the sea.  Each piece is carefully crafted based on our deep and intimate understanding of the water sports community.  Brand Story  AXESEA designs and produces quality swimwear, wetsuits, and water sports accessories.  AXESEA was born in 2010 when three surfers crossed paths in Surfers Point, Australia on a common search for high-quality, affordable swimwear that stands up to the harsh elements of the sea.  Each piece is carefully crafted based on our deep and intimate understanding of the water sports community.  Pentashell THERMAL is the newest member of the Pentashell family. Warm like a thin wetsuit and flexible like a rash guard, this unique double-layered fabric offers a new option for water activities in moderately cold temperatures.  Pentashell THERMAL bridges the gap between the rash guard and wetsuit. It enables the creation of our unique surf suits for moderately cold conditions.  Use our surf suits alone in moderately cold temperatures for warmth and protection, or wear it as a base layer under a wetsuit for enhanced heat retention in colder temperatures.  We use neoprene and adhesive free.Made  entirely free of neoprene and adhesive. 
