INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (218, '2024-05-27 22:18:14.738', '2024-05-27 22:18:14.738', null, 1, 0, 0, 102, 0, 'SUN CUBE Surf Poncho Changing Robe with Hood | Quick Dry Microfiber Wetsuit Changing Towel with Pocket for Surfing Men Women              ', '["/crawling/product/41XqEIzA7-L._AC_SR512_.jpg","/crawling/product/41S6SQPCevL._AC_SR512_.jpg","/crawling/product/518Xt735ZSL._AC_SR512_.jpg","/crawling/product/51Cam5MxrQL._AC_SR512_.jpg","/crawling/product/51PepWXHZoL._AC_SR512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' About Sun Cube  Sun Cube builds quality performance gear that lets you achieve more out in the sun!  Our Products  At Sun Cube, we offer premium headwear that protects our customers in the sun and allow them to achieve and perform better in any outdoor activities. Our products are meticulously designed with the finest materials and functions, making them versatile and functional at the same time.  This poncho is the ultimate personal changing room to discretely swap out clothes at the beach, park, and public places. The large size hoodie provides a spacious environment to easily move around and quickly remove your wet, dirty, and comfortable clothes. Constructed of 100% microfiber polyester, the poncho doubles as water absorbing towel for drying off after surfing, swimming, or showering at camp. 
