INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (220, '2024-05-27 22:18:25.562', '2024-05-27 22:18:25.562', null, 1, 0, 0, 102, 0, 'Red Cell Slant Zip Hooded Fullsuit 5/4/3MM              ', '["/crawling/product/31C73-J5KEL._AC_SR512_.jpg","/crawling/product/31BeEdtkPWL._AC_SR512_.jpg","/crawling/product/31eEPm+y53L._AC_SR512_.jpg","/crawling/product/31H7w5dM3eL._AC_SR512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', 'INFRARED INSULATION -> The interior of the Red Cell is lined with infrared insulated fabric keeping you warmer longer. Meaning you will be able to still be riding waves long after everyone has gone back to shore due to the cold.SLANT ZIP EASY ENTRY -> The Red Cell slant zip true enough to its name is equipped with a slanted zipper across the suits chest for easy entry. With an added left shoulder bib cinch and cordlock this wetsuit can be adjusted to the wearer for a more comfortable fit.NANO KNEEPAD TECHNOLOGY -> The Red Cell Slant Zip Fullsuit comes equipped with nano tritec kneepads made with comfort and mobility in mind. The wearer can worry less about sore knees and more about catching waves.LEFT SHOULDER CINCH -> With the slanted zipper on the chest of the Red Cell the wetsuit also comes equipped with a left shoulder bib cinch and cordlock. Because of this addition you can fasten the wetsuit to fit you perfectly with no loose feeling to keep the cold out and all your warmth in.STREAMLINE DESIGN & DRAIN SYSTEM -> The Red Cell has ergonomic panel construction married with the stitch-free Micro-Bead exterior seam seal creates a true fit with minimal restriction to movement. Evo-Flex interior seam tape, raw edge wrist and ankles, front and back integrated drain system with a Glide-Skin interior neck seal with all this the Red Cell is in no way lacking in design nor function.');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (221, '2024-05-27 22:18:35.265', '2024-05-27 22:18:35.265', null, 1, 0, 0, 102, 0, 'Cressi Termico Lady              ', '["/crawling/product/41NQIrQbQnL._AC_SR512_.jpg","/crawling/product/41Z7gUeOnYL._AC_SR512_.jpg","/crawling/product/41BO-32S8aL._AC_SR512_.jpg","/crawling/product/3107YBMOHCL._AC_SR512_.jpg","/crawling/product/41yAp+EdA7L._AC_SR512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '                          Cressi was founded in 1946 as a diving company rich in innovation, design, development, manufacturing. An entirely family-owned and operated Italian brand, Cressi is one of the first companies to develop innovative equipment for watersports. Over 70 years later, the commitment to innovation is still in the company’s DNA. The passion that stimulated the founders to begin their adventure is still present and, combined with the advanced technology, results in the best and most reliable products!  Sleek and flattering, the Cressi Termico Lady Thermo Suit is an all-in-one suit that\'s shaped like a traditional one piece with added neoprene for colder temperatures.  Allows for greater freedom of movement.  Can be used as a standalone wetsuit in warmer waters or as an undergarment to a standard neoprene wetsuit for added warmth in cooler water.  Thermal shorty for swimming, in highly elastic 2 millimeter Ultra-span lined neoprene. Glide-skin, anti-friction treatment in the underarm area. Glide-skin anti-seepage seals at the neck and legs. Front zip.  Size: S/2 M/3 L/4 XL/5 XXL/6.  Swimming Pool.  Aqua Gym.  Open Water Swimming.  Women’s all-in-one suit that is shaped like a one-piece swimsuit. Designed specifically for swimming, snorkeling and water sports in general, it allows greater freedom of movement due to the special style and elasticity of the material.  It is made from double lined 2 mm neoprene and comes with a front zip that makes it easy to put on and take off.  Size: XS/1 S/2 M/3 L/4 XL/5. 
