INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (227, '2024-05-27 22:19:15.883', '2024-05-27 22:19:15.883', null, 1, 0, 0, 102, 0, 'Hyperflex Access Men’s and Women’s Full Body 3mm Backzip Wetsuit - Warm 4-Way Stretch Neoprene - Adjustable Collar and Flat Lock Construction - High Performance 50+ UV SHIELD              ', '["/crawling/product/31ahyVE6yLL._AC_SR512_.jpg","/crawling/product/31caX2DPGbL._AC_SR512_.jpg","/crawling/product/31h-gS2d2sL._AC_SR512_.jpg","/crawling/product/31iEBpn5hOL._AC_SR512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '                          Hyperflex is staffed by surfers, kite boarders, watermen, photographers and artists. We work every day to bring you the best wet suits products for the money. We are not happy, until you are happy with your Hyper flex Product. This is what we strive for every day. Visit our official website for more information.  Access Series wet suits are designed for an entry level surfer and are a perfect choice for your first surfing wet suit.  Packed with all of the necessary features like Storm force knee pads, Chill breaker mesh skin panels, and underarm gussets; the wet suit is an outstanding value.  Anatomically cut pattern provides a glove-like fit and patterned to fit the widest variation of sizes and shapes.   Easy and fuss-free sizing in children’s, juniors and adults.  Designed to increase warmth without increasing thickness allowing you to surf, paddleboard, windsurf, water ski, wakeboard lighter, longer, and warmer.  Your wallet will thank you and you will be warm, comfortable and happy. A superior value among all other options.  A highly abrasion-resistant textile outer surface which does not inhibit movement and adds additional protection and comfort to the knee. 
