INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (251, '2024-05-27 22:23:58.385', '2024-05-27 22:23:58.385', null, 1, 0, 0, 102, 0, 'AXESEA Women\'s Wetsuit One Piece Shorty Wetsuit Eco Friendly Thermal Long Sleeve Front Zipper Diving Suit              ', '["/crawling/product/416vMEOkx7L._AC_US512_.jpg","/crawling/product/31xlNEMGJfL._AC_US512_.jpg","/crawling/product/41JBGvX0JqL._AC_US512_.jpg","/crawling/product/41P8LVUmF-L._AC_US512_.jpg","/crawling/product/51xcz9I9MtL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  Visit the Store    Visit the Store    Visit the Store    Visit the Store   As big as the earth is, we are one  AXESEA designs and produces quality swimwear, wetsuits, and water sports accessories.  AXESEA was born in 2010 when three surfers in Australia on a common search for high-quality, affordable swimwear that stands up to the harsh elements of the sea.  Each piece is carefully crafted based on our deep and intimate understanding of the water sports community.  Brand Story  AXESEA designs and produces quality swimwear, wetsuits, and water sports accessories.  AXESEA was born in 2010 when three surfers crossed paths in Surfers Point, Australia on a common search for high-quality, affordable swimwear that stands up to the harsh elements of the sea.  Each piece is carefully crafted based on our deep and intimate understanding of the water sports community.  Pentashell THERMAL is the newest member of the Pentashell family. Warm like a thin wetsuit and flexible like a rash guard, this unique double-layered fabric offers a new option for water activities in moderately cold temperatures.  Pentashell THERMAL bridges the gap between the rash guard and wetsuit. It enables the creation of our unique surf suits for moderately cold conditions.  Use our surf suits alone in moderately cold temperatures for warmth and protection, or wear it as a base layer under a wetsuit for enhanced heat retention in colder temperatures.  We use neoprene and adhesive free.Made  entirely free of neoprene and adhesive. 
