ize carefully  according to the chest and waist size from Skyone size chart.  •Hands wash with cool water, Do not machine wash  •Due to everyone’s stature is difference and measuring   tolerance ±1cm allowed, if you feel not fit for your size, please simply   contact with us freely  •PACKAGE INCLUDE:One Piece 3MM Women Men Neoprene Full Wetsuit  There\'s no better way to enter the water than with Skyone 3MM scuba full wetsuit, wrap yourself in pure Comfort and Performance  Wrist and leg zippers and anti-friction flaps prevent zippers from scratching skin and allow for easy on and off  Made of durable and wear-resistant materials, it also ensures sportiness  Seal design for neck wrist and leg, the smooth neoprene can attach to the skin to prevent water flushing in  Easy to put on and take off by yourself.Neckline design bound with alayer of cloth,make it more durable  The fashionable and durable sewing method provides reliable sports support without imparing stretchability  Does this full body wetsuit smell?   A little, but don\'t worry, the 3MM Neoprene wetsuit uses glue from material, which is harmless and the smell will dissipate after a few days.  What is the best way to clean the wet suit?   I suggest handwashing in cold to lukewarm water; hang to dry.  Is the full body wetsuit zipper heavy duty?  YES,Easy on and off with strong front zipper design, fit tight and snug,excellent stretch provides your a free movement without restriction.  How loose do they get in the water?  Not loose at all! Beautifully designed, 3mm warm, snug. The women wetsuit is to keep you warm in the cold water.  3MM Full Body Wetsuit  3MM Shorty Wetsuit  2MM Shorty Wetsuit  3MM Wetsuit top  3MM Wetsuit pants  2.5MM Neoprene Wetsuit  2.5MM Full body wetsuit ');
