INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (271, '2024-05-27 22:25:51.076', '2024-05-27 22:25:51.076', null, 1, 0, 0, 102, 0, '3mm Neoprene Wetsuit Full Body Long Sleeve Back Zip Neoprene Diving Suit Thermal Suit for Water Sports Kayakboarding Surfing Snorkeling Scuba Diving Swimming              ', '["/crawling/product/411bBD2D5xL._AC_US512_.jpg","/crawling/product/31Cab-VjkIL._AC_US512_.jpg","/crawling/product/51Dq-qjq5IL._AC_US512_.jpg","/crawling/product/51z0remhkPL._AC_US512_.jpg","/crawling/product/3106VwbIiOL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' ZCCO has more than 12 years of experience in the production of wetsuit products. We have devoted ourselves to research and development of wetsuit products and have a skilled wetsuit production team. ZCCO wetsuit not only has the functional characteristics of wetsuit but also has a unique appearance, classic and fashion coexist.  In the end, it provides high-quality and suitable diving suits for many diving enthusiasts.  Our diving suits are made of high quality SCR neoprene,  let you just enjoy the fun for multi water sports freely.  The 2mm neoprene wetsuit pants is great for snorkeling ,diving ,kayaking,fitness, surfing, floating swimming. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (272, '2024-05-27 22:25:56.636', '2024-05-27 22:25:56.636', null, 1, 0, 0, 102, 0, 'Owntop Shorty Wetsuit for Men Women - 3mm Neoprene Diving Suits Stretch Short Sleeve Dive Skin Front/Back Zip UPF50+ Thermal Swimwear for Surfing Swimming Snorkeling Water Sports              ', '["/crawling/product/41qbg7nOesL._AC_US512_.jpg","/crawling/product/51R9WKtPHjL._AC_US512_.jpg","/crawling/product/41xWskOQiZL._AC_US512_.jpg","/crawling/product/51jKdQfwsZL._AC_US512_.jpg","/crawling/product/41XbdoiIK8L._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  Trust us, we will do better in the future!   Visit the Store    Visit the Store    Visit the Store   Wetsuits are made of neoprene, which creates a thin layer of water between your skin and the wetsuit. This water is heated to match your body temperature, creating an insulating barrier against cold water.  1. Please read the size chart carefully before purchasing. For occasionally player suggest one size up if don\'t want to feel tight;  2. Due to the folded packaging, creases are inevitable during shipping. They will disappear after a few wears;  3. Wetsuit will have a slight smell the first time you wear it. It can be hung in a ventilated and shaded place to remove odors.  3mm Shorty Wetsuit  Men 3mm Shorty Wetsuit  3mm Neoprene Wetsuit  3/2.5mm Neoprene Wetsuit  5mm Neoprene Wetsuit  3mm Spearfishing Wetsuit  Why does a wetsuit have creases?  The soft, elastic Neoprene material can form creases during transportation. Unfold and stretch the wetsuit to remove.  How can I remove the smell of a new wetsuit?  Neoprene wetsuits have a distinct odor, but it will dissipate over time and with airing out or washing.  How do I clean a wetsuit?  Soak in cold water and rinse well, wetsuit cleaner is recommended, dry in the shade after washing, avoid sunlight and hot water.  How do I choose the right size?  Refer to the size chart and measure chest, waist, and height. Consider body shape. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (273, '2024-05-27 22:26:02.823', '2024-05-27 22:26:02.823', null, 1, 0, 0, 102, 0, 'Shorty Wetsuit Men and Women,2mm Neoprene Short Sleeves Wet Suits Back Zip, 1.5mm Shorty Surf Suit Keep Warm in Cold Water for Snorkeling Kayaking Boarding              ', '["/crawling/product/41+YSLsnR5L._AC_US512_.jpg","/crawling/product/51HbVfBaAdL._AC_US512_.jpg","/crawling/product/41BVrdjJJlL._AC_US512_.jpg","/crawling/product/41MJnLzlLbL._AC_US512_.jpg","/crawling/product/41RQoTjvfIL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  Visit the Store   FLEXEL is a brand specializing in outdoor water sports, mainly producing diving suits，surfing suit and so on. The brand meaning of "FLEXEL" is "flexible": flexibility; elasticity.  Wetsuits are an amazing tool that let surfers, swimmers, and water lovers alike stay in the water all year long.  Choosing the right thickness of wetsuit for the area and activity that you will be doing is the first step to staying warm and happy, ready to focus on fun.  A wetsuit is a neoprene insulation suit made for warmth and protection in watersports. Wetsuits work by trapping a thin layer of water between your body and the suit. keep warm in the cold water.  shorty wetsuit work by trapping a thin layer of water between your body and the suit. keep warm in the cold water.  One of the most important aspects when considering wetsuit warmth is the thickness of the neoprene.   Wetsuit thickness is measured in millimeters, represented with two or three numbers separated by a slash.for example 3mm ,3/2mm ,5/4mm .   The first number represents the thickness of the neoprene in the torso area, the second number represents the thickness of the neoprene in the extremities. 
