INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (282, '2024-05-27 22:26:50.008', '2024-05-27 22:26:50.008', null, 1, 0, 0, 102, 0, 'Women\'s Limestone Neoprene Wetsuit Shorty Wet Suits for Women in Cold Water Long-Sleeve Half Leg Water Suits Springsuit for Scuba Diving Surfing Kayaking Canoeing Snorkeling Swimming - 2.0mm              ', '["/crawling/product/31PaPXJz0fL._AC_US512_.jpg","/crawling/product/51Ru-uSP3bL._AC_US512_.jpg","/crawling/product/510EtILlWEL._AC_US512_.jpg","/crawling/product/61sDCd5S4EL._AC_US512_.jpg","/crawling/product/51kmYpdwqlL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' We want to provide you with gear that is filled with comfort, fun, appeal and promotes a healthy lifestyle.  As a kitesurfer, I wasn\'t able to find cute high-quality water gear that would protect me from the sun & rashes. So my sister Elena & I started Platinum Sun in 2014 in Miami Beach, FL, to offer our community better options for sun-protective clothing  Being kite surfers ourselves we have designed our products to be fashionable but also include important practical details  We enjoy designing & developing products. We are inspired by fellow pro water athletes & want to protect them from the elements &  harmful UV rays   Visit the Store  ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (283, '2024-05-27 22:26:55.720', '2024-05-27 22:26:55.720', null, 1, 0, 0, 102, 0, 'Wetsuit Top for Women and Men, 2mm 3mm Neoprene Wet Suit Jacket Front Zip Long Sleeve Keep Warm in Cold Water for Surfing Paddling Snorkeling and Kayaking              ', '["/crawling/product/412seXnlwnL._AC_US512_.jpg","/crawling/product/51uqLMvaXoL._AC_US512_.jpg","/crawling/product/51amjchAVfL._AC_US512_.jpg","/crawling/product/41qWjG38YYL._AC_US512_.jpg","/crawling/product/41r78UHZGwL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', '  Visit the Store   FLEXEL is a brand specializing in outdoor water sports, mainly producing diving suits，surfing suit and so on. The brand meaning of "FLEXEL" is "flexible": flexibility; elasticity.  Wetsuits are an amazing tool that let surfers, swimmers, and water lovers alike stay in the water all year long.  Choosing the right thickness of wetsuit for the area and activity that you will be doing is the first step to staying warm and happy, ready to focus on fun.  Tops or vests made out of 0.5-2 mm neoprene that can be paired with boardshorts or a bikini bottom, primarily used for warmer water sports. Wetsuit vests can also be layered under a full suit for extra warmth in cold water.  Neoprene pants, leggings or shorts primarily used in warmer water temperatures. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (284, '2024-05-27 22:27:01.760', '2024-05-27 22:27:01.760', null, 1, 0, 0, 102, 0, 'DEHAI Wetsuit Men Women Neoprene Diving Wet Suits, 2mm & 3mm Shorty/Long Sleeve Youth/Adult Full Body Thermal Swimsuit in Cold Water Keep Warm for Swimming Scuba Surfing              ', '["/crawling/product/414TdzorvTL._AC_US512_.jpg","/crawling/product/513Mtb+lOPL._AC_US512_.jpg","/crawling/product/51Fhbc54ATL._AC_US512_.jpg","/crawling/product/51bGzs4mVYL._AC_US512_.jpg","/crawling/product/51I3SutOGeL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' Water Sports Keep Warm for Diving Swimming Waterski Surfing  Packing: We choose high-quality PE self-sealing bag, in order to decrease  transportation damage to the wetsuits. When you open the bag, there are  usually any slightly fold lines which are acceptable according to our  quality policy. We beg your understanding, because the fold line cannot  be avoided completely.  Odor: Open the bag and when you find any nasty smell, don\'t worry please. this  odor is not harmful to you. The wetsuit is a kind of clothing usually  made of foam neoprene,  and glue is needed to form a tight junction  between the fabric and rubber. Then you will smell a glue. Please place  the wetsuit in a  ventilated place for a period of time or washed in  water, the wetsuit will lose its taste. the smell will disappear soon.  We only use healthy glue materials.                           DEHAI focuses on the manufacture of diving equipment, has the core production technology, the use of the highest quality materials, production and sales of the most cost performance products. To provide customers with a better use experience.  DEHAI Wetsuits are specially designed for men and women. If you are have a wetsuit, you can swim, surf or scuba diving at any time. The 3mm neoprene wetsuits are worn suitable for 50℉- 67℉.  In open water, you can avoid being injured by marine organisms, and avoiding water pollution causing skin sensitivity. The wetsuits provide you better protection. 
