INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (320, '2024-05-27 22:35:24.262', '2024-05-27 22:35:24.262', null, 1, 0, 0, 102, 0, 'Mens Wetsuit Top Jacket - Neoprene Long Sleeve for Warmth & Comfort- Surfing, Snorkeling, All Watersports - w/Extended Back Flap and Durable YKK Locking Front Zipper              ', '["/crawling/product/312Sb4i743L._AC_US512_.jpg","/crawling/product/418TvOsDTOL._AC_US512_.jpg","/crawling/product/41n4oKuRu0L._AC_US512_.jpg","/crawling/product/51IhMXI8OyL._AC_US512_.jpg","/crawling/product/51wlJahwcxL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' I\'m Alec and grew up surfing in Dana Point, CA together with my co-founder Brian. We design all our surf gear and surf It ourselves!   Visit the Store    Visit the Store   We started Surf Squared because we couldn’t find surf gear we liked or didn\'t like repping large logos. The gear we did like, we couldn’t afford or didn\'t like spending our last shirt on.   We believe in creating top-quality and great looking surf gear, with the best value and best service.   Having grown up surfing from young age, we look to make high-performance surf gear that is durable, well designed without wild colors. We surf and test all our products every day.  We want our customers to have fun surfing and to surf better!   LET\'S GO SURFING!  Sasha with our ripper fiberglass thrusters.  Our Wetsuits keep you warm and comfy.  Seaside Quads for epic small wave performance. 
