INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (326, '2024-05-27 22:35:57.825', '2024-05-27 22:35:57.825', null, 1, 0, 0, 102, 0, 'Lemorecn Wetsuits Pants Shorts 3mm Neoprene Canoeing Swimming Pants              ', '["/crawling/product/31FW210rmWL._AC_SR512_.jpg","/crawling/product/41QZCU-dzdL._AC_SR512_.jpg","/crawling/product/41tJmuUsFUL._AC_SR512_.jpg","/crawling/product/51ao40Q2qSL._AC_SR512_.jpg","/crawling/product/4190gKcqM9L._AC_SR512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' KEEP WARM, BRING COMFY, PROVIDE PROTECTION FOR YOUR AQUATIC SPORTS.  EXPLORE THE UNKNOW  CHALLENGE YOURSELF  ENJOY THE FREEDOM    Off centered barrel cinch shock cord An off centered barrel cinch shock cord at the waist ensures a secure, custom fit.High-waist and tall back ensures your Lemorecn pants are properly positioned.  Flat Lock Stitching Interlocked thread on both sides of the wetsuit pants improves wearability and, by lapping the neoprene together creates a flat, smooth, irritation free seam, for a smooth interior and exterior surface to ensure comfort and durability.  Water Activities Multi-Sport  Perfect for for diving, paddleboarding, kiteboarding, wakeboarding, kayaking, canoeing and other water sports. Keep you warm in the coldest conditions. ');
INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (327, '2024-05-27 22:36:02.434', '2024-05-27 22:36:02.434', null, 1, 0, 0, 102, 0, 'Wetsuit Pants Men Womens Wet Suits Swim Tights 3mm Neoprene Swimming Leggings 2mm Long Diving Surfing Kayak Pant Keep Warm for Workout Scuba Snorkeling Canoeing Water Sports              ', '["/crawling/product/2196ApscfJL._AC_US512_.jpg","/crawling/product/51mCbepLjUL._AC_US512_.jpg","/crawling/product/51HMCnuGXrL._AC_US512_.jpg","/crawling/product/41YGSPwFbUL._AC_US512_.jpg","/crawling/product/41wEng25+KL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' Bold, Lively,Effortlessly Cool! Top kids wetsuit is sure to pay dividends in your child aquatic adventure.#Buoyancy #Protection  REALON - Bold, Lively, and Effortlessly Cool! Not only do kids wetsuits keep your baby warm and comfortable in cooler waters, but they also provide added buoyancy and protection from scrapes and scratches. allow for greater flexibility and range of motion, investing in a top-of-the-line wetsuit is sure to pay dividends in your child next aquatic adventure. #watersports #surfing #diving #swimming #buoyancy #protection #flexibility.  Full Body Diving Skin Suit Swimsuit for Kids -Boys Girls and Adult -Womens Mens  For many children,one-piece full wetsuit will make them feel constricted,this is necessary for them as it provides warmth and buoyancy, until your child gets used to it, please be aware that only a snug fit is waterproof, too loose can make you feel cold very quickly.   Yes.  the kids wetsuit can be be worn alone as a springsuit in warm weather and over a full wetsuit or lycra skin for added warmth in cold weather.  2t 3t baby to 13 years old youth can choose them.  ✔ Thickness: 2mm or 3mm.  ✔ Material: 90% Neoprene and 10% Nylon.  ✔ UPF 50+ Sun Protection & Durable Flatlock Stitching & Keep Body Warm.  ✔ Suit for Diving Swimming Surfing Snorkeling Canoe Scuba, Don\'t worry, it Will Protect You From Cold Water Effectively.  ✔ Stretchable Nylon High elasticity fabric stretches in all directions allowing you to move freely without any restrictions.  ✔ Adjustable Waist,these wetsuits pants are easily to be matched with any type of vests,sports bras and tank top.  ✔ Our diving pants adopts quick drying,moisture wicking and breathable fabric that keep your body dry while you do some water sports.  NO.1  Make sure the measurements of height, weight, chest before ordering.It is quite easy to measure chest, use a tape to measure circumference of the fullest chest.The more accurate measurements you have, the better size you will get according to measurements.  NO.2  Kindly keep your body dry while you are trying on the wetsuit. Drag the pants to crotch, Comfortable and fitted flat opening design, it reduces water entering significantly, it helps to release elasticity of material, makes the wetsuit pants more comfortable and without restriction.  NO.3  If you can\'t find the right size,please send the product number and your kids height and chest to REALON help.  This size chart is only for this product!!!  1.FIT TO SIZE  Only tight wetsuit could keep your body warm, ask your kid to get used to it, the fabric need time to fit different body shape, loose wetsuit will not keep your body warm, kids will get cold.  2.WRINKLE ON WETSUIT:  You will find there are wrinkles on the wetsuit after you open the bag, kindly note that those wrinkles are inevitable, but do not worry, those wrinkles will be disappeared gradually.  3.ODOUR  You may get an unpleasant smell after package opened, but don\'t worry, it is the smell of glue and it is harmless for human.  You can wash it by fresh water, or spread the wetsuit in the open air or well-ventilated place, the smell will fade  4.THICKNESS OF WETSUIT:  The thickness of raw neoprene is a piece of foam, and some area will be thicker