nce, because the official size chart is exactly matched with the actual jacket size, if you choose the size according to your experience, it may be smaller.  NO.2  For many people, wetsuit jacket can make them feel contracted, this is normal, this is necessary for them to provide warmth and buoyancy, until your get used to it. ');
