INSERT INTO shop.product (id, created_at, updated_at, deleted_at, admin_id, parent_id, store_id, category_id, assets_id, name, images, money, discount, type, sort, sales, status, data, `desc`) VALUES (365, '2024-05-27 22:45:55.818', '2024-05-27 22:45:55.818', null, 1, 0, 0, 102, 0, 'Lemorecn (16 Sizes) Mens Wetsuits Jumpsuit Neoprene 3/2mm and 5/4mm Full Body Diving Suit for Men and Women              ', '["/crawling/product/316obiwdm3L._AC_US512_.jpg","/crawling/product/41NMlx2faAS._AC_US512_.jpg","/crawling/product/31JsSoa2HmS._AC_US512_.jpg","/crawling/product/31heca08I1L._AC_US512_.jpg","/crawling/product/51+sOI6L1nL._AC_US512_.jpg"]', 0.000000, 0.0000, 2, 99, 0, 10, '', ' KEEP WARM, BRING COMFY, PROVIDE PROTECTION FOR YOUR AQUATIC SPORTS.  EXPLORE THE UNKNOW  CHALLENGE YOURSELF  ENJOY THE FREEDOM  Lemorecn Wetsuits  Men\'s 3/2 mm and 5/4mm Full Suit  Designed for comfort and warmth , while also featuring high quality premium neoprene material and flatlock seams.  Anatomically cut pattern provides a glove-like fit and patterned to fit the widest variation of sizes and shapes.  Packed with all of the necessary features like knee pads, extra-long leash; the wetsuit is an outstanding value.  Ideal for long-lasting mobility of diving, surfing, snorkeling and virtually all underwater and topside watersports; perfect in all conditions from warm to temperate, and even cold water.  Multi-Sport  Designed to increase warmth without increasing thickness allowing you to surf, paddleboard, windsurf, water ski, wakeboard lighter, longer, and warmer.  Durability  The wetsuit is designed with flatlock seams for improved durability.The extra durability and reliability makes this wetsuit ideal for those that spend hours in the water.  Warmth  Designed to increase warmth allowing you to dive, snorkel, and scuba, longer, and warmer.    Extra Large Zip #10 YKK Zip Knee Pads Flexible, anti-abrasion knee pads minimize scraping Flat Lock Stitching Flat lock stitching throughout to reduce seam irritation');
